import React, {useCallback} from 'react';

const Publish = () => {
	const handleAddQue = useCallback((e)=>{
		e.preventDefault();
	},[]);


	return (
		<div>
			<form action="">
				<input type="text" placeholder={'请输入问卷标题'}/>
				<input type="text" placeholder={'请输入问卷描述'}/>
				{children}
				<button onClick={handleAddQue}></button>
			</form>
		</div>
	);
};

export default Publish;
